const Index = ({todoItems}) => {
    return(
        todoItems.map((item) => {
            const{id,name,description} = item;
            return (
              <tr>
                <td>{id}</td>
                <td>{name}</td>
                <td>{description}</td>
                <td>
                  <button>Update</button>
                </td>
              </tr>
            )
        })
    )
}

export default Index;
